import React from 'react';

function User({ user }){
    return(
        <div>
        <b>{user.username}</b><span>({user.email})</span>
    </div>
    )
}

function UserList(){
    const users = [
        {
            id: 1,
            username: 'test1',
            email: 'test@naver.com',
        },
        {
            id: 1,
            username: 'test1',
            email: 'test@naver.com',
        },
        {
            id: 1,
            username: 'test1',
            email: 'test@naver.com',
        },
    ];
    return (
        <div>
            {
                users.map(
                    user => (<User user={user} key={user.id}/>)
                )
            }
        </div>
    );
}

export default UserList;
